import { createApi, fetchBaseQuery } from '@reduxjs/toolkit/query/react';


export const plantsApi = createApi({
    reducerPath: "plantsApi",
    baseQuery: fetchBaseQuery({
        baseUrl: "https://dev-agwa-public-static-assets-web.s3-us-west-2.amazonaws.com/data/catalogs/",
    }),
    endpoints: (builder) => ({

        getPlants: builder.query({

            query: (type) => `${type}`,

        })
    })
})


export const { useGetAllPlantsQuery } = plantsApi;

console.log('kokor');


fetch('https://dev-agwa-public-static-assets-web.s3-us-west-2.amazonaws.com/data/catalogs', {
  method: 'GET',
  headers: {
    Accept: 'application/json',
    'Content-Type': 'application/json'
  },
  body: JSON.stringify({
    firstParam: 'yourValue',
    secondParam: 'yourOtherValue'
  })
});


const getMoviesFromApiAsync = async () => {
    try {
        const response = await fetch(
            'agwafarm.json'
        );
        const json = await response.json();
        return json.categories;
    } catch (error) {
        console.error(error);
    }
};

const data = getMoviesFromApiAsync();
if (data) console.log('data', data);
